import logo from './logo.svg';
import './App.css';
import axios from 'axios';
function App() {
  const[poke, setPoke] = useState(()=>{
    axios.get('https://pokeapi.co/api/v2/pokemon')
    .then(res => {
      setPoke({res})
      console.log(res.results);
    })

  })



  return (
    <div className="App">

    </div>
  );
}

export default App;
